    <script>
        // TypedArray utilities
        function decodeTypedArray(encoded) {
            const { dtype, shape, data } = encoded;
            const bytes = atob(data);
            const buffer = new ArrayBuffer(bytes.length);
            const view = new Uint8Array(buffer);
            
            for (let i = 0; i < bytes.length; i++) {
                view[i] = bytes.charCodeAt(i);
            }
            
            switch(dtype) {
                case 'float32': return new Float32Array(buffer);
                case 'uint32': return new Uint32Array(buffer);
                case 'uint16': return new Uint16Array(buffer);
                case 'uint8': return new Uint8Array(buffer);
                default: throw new Error('Unknown dtype: ' + dtype);
            }
        }
        
        // Dashboard controller
        class FinalDashboard {
            constructor(data) {
                this.rawData = data;
                this.columns = data.metadata.columns;
                this.totalRows = data.metadata.total_rows;
                
                // Decode TypedArrays
                this.data = {};
                for (const col of this.columns) {
                    this.data[col] = decodeTypedArray(data.data[col]);
                }
            }
            
            async initialize() {
                const startTime = performance.now();
                
                // Prepare data for Vega-Lite - sample for performance
                const fullData = [];
                const sampleStep = Math.max(1, Math.floor(this.totalRows / 10000));
                
                for (let i = 0; i < this.totalRows; i += sampleStep) {
                    const row = {};
                    for (const col of this.columns) {
                        row[col] = this.data[col][i];
                    }
                    fullData.push(row);
                }
                
                // Create spec following the Observable example pattern exactly
                const spec = {
                    $schema: 'https://vega.github.io/schema/vega-lite/v5.json',
                    data: { values: fullData },
                    config: {
                        background: '#161b22',
                        axis: {
                            domainColor: '#30363d',
                            gridColor: '#21262d',
                            tickColor: '#30363d',
                            labelColor: '#8b949e',
                            titleColor: '#8b949e'
                        }
                    },
                    
                    // Define the brush at the top level
                    params: [{
                        name: 'brush',
                        select: {
                            type: 'interval',
                            encodings: ['x'],
                            resolve: 'intersect'
                        }
                    }],
                    
                    hconcat: [
                        // Histograms with repeat
                        {
                            repeat: {
                                row: this.columns
                            },
                            spec: {
                                width: 250,
                                height: 120,
                                layer: [
                                    // Background layer - all data
                                    {
                                        mark: { 
                                            type: 'bar',
                                            color: 'lightgrey',
                                            opacity: 0.5
                                        },
                                        encoding: {
                                            x: {
                                                field: { repeat: 'row' },
                                                type: 'quantitative',
                                                bin: { maxbins: 30 }
                                            },
                                            y: {
                                                aggregate: 'count',
                                                type: 'quantitative',
                                                title: null
                                            }
                                        }
                                    },
                                    // Filtered layer - selected data
                                    {
                                        transform: [{ filter: { param: 'brush' } }],
                                        mark: { 
                                            type: 'bar',
                                            color: '#58a6ff'
                                        },
                                        encoding: {
                                            x: {
                                                field: { repeat: 'row' },
                                                type: 'quantitative',
                                                bin: { maxbins: 30 }
                                            },
                                            y: {
                                                aggregate: 'count',
                                                type: 'quantitative'
                                            }
                                        }
                                    }
                                ]
                            }
                        },
                        // Scatter plot
                        {
                            width: 450,
                            height: 450,
                            mark: {
                                type: 'point',
                                size: 60,
                                filled: true
                            },
                            encoding: {
                                x: {
                                    field: this.columns[0],
                                    type: 'quantitative',
                                    scale: { zero: false },
                                    title: this.columns[0]
                                },
                                y: {
                                    field: this.columns[1],
                                    type: 'quantitative',
                                    scale: { zero: false },
                                    title: this.columns[1]
                                },
                                color: {
                                    condition: {
                                        param: 'brush',
                                        value: '#58a6ff'
                                    },
                                    value: 'grey'
                                },
                                opacity: {
                                    condition: {
                                        param: 'brush',
                                        value: 0.8
                                    },
                                    value: 0.1
                                },
                                tooltip: this.columns.map(col => ({
                                    field: col,
                                    type: 'quantitative',
                                    format: col === 'income' ? ',.0f' : '.2f'
                                }))
                            }
                        }
                    ]
                };
                
                try {
                    // Embed the visualization
                    const result = await vegaEmbed('#dashboard', spec, {
                        actions: false,
                        renderer: 'canvas'
                    });
                    
                    // Track performance
                    const loadTime = performance.now() - startTime;
                    document.getElementById('loadTime').textContent = `${loadTime.toFixed(0)}ms`;
                    document.getElementById('selectedCount').textContent = 
                        `${fullData.length.toLocaleString()} / ${fullData.length.toLocaleString()}`;
                    
                    // Listen for brush changes
                    result.view.addSignalListener('brush', (name, value) => {
                        const startTime = performance.now();
                        
                        // Count selected points
                        let count = 0;
                        if (value) {
                            const data = result.view.data('data_0');
                            for (const item of data) {
                                let selected = true;
                                for (const col of this.columns) {
                                    if (value[col]) {
                                        const [min, max] = value[col];
                                        if (item[col] < min || item[col] > max) {
                                            selected = false;
                                            break;
                                        }
                                    }
                                }
                                if (selected) count++;
                            }
                        } else {
                            count = fullData.length;
                        }
                        
                        document.getElementById('selectedCount').textContent = 
                            `${count.toLocaleString()} / ${fullData.length.toLocaleString()}`;
                        
                        const brushTime = performance.now() - startTime;
                        document.getElementById('brushTime').textContent = `${brushTime.toFixed(1)}ms`;
                    });
                    
                    document.getElementById('status').textContent = 
                        `Ready! Brush on any histogram to filter. Showing ${fullData.length.toLocaleString()} points.`;
                        
                } catch (error) {
                    console.error('Visualization error:', error);
                    document.getElementById('status').textContent = 'Error: ' + error.message;
                }
            }
        }
        
        
        // Decompress data if needed
        async function loadData() {
            const status = document.getElementById('status');
            
            try {
                status.textContent = 'Decompressing data...';
                const compressed = atob(embeddedData);
                const bytes = new Uint8Array(compressed.length);
                for (let i = 0; i < compressed.length; i++) {
                    bytes[i] = compressed.charCodeAt(i);
                }
                
                const decompressed = pako.inflate(bytes, { to: 'string' });
                const data = JSON.parse(decompressed);
                
                status.textContent = 'Data loaded! Initializing dashboard...';
                return data;
            } catch (error) {
                status.textContent = 'Error: ' + error.message;
                console.error(error);
                throw error;
            }
        }
    
        
        // Initialize
        async function init() {
            try {
                const data = await loadData();
                const dashboard = new FinalDashboard(data);
                await dashboard.initialize();
            } catch (error) {
                document.getElementById('status').textContent = 'Error: ' + error.message;
                console.error(error);
            }
        }
        
        window.addEventListener('DOMContentLoaded', init);
    </script>
</body>
</html>
